import { useState } from "react";
import NavBarComp from "../../components/NavBarComp";
import { getCurrentLocation } from "../../utils/LocationManager";


function ParkingPage({citys}) {

    const [latLng, updateLatLng]= useState();
    const [showParkingAddressModal ,setShowParkingAddressModal] = useState(false);

    return(<div>
            <NavBarComp />    
            {latLng ?             <iframe
                width="800"
                height="650"
                style={{border:0}}
                loading="lazy"
                allowFullScreen
                src={`https://www.google.com/maps/embed/v1/place?key=AIzaSyCNKfsXeTiMfS66RSVSMuYv5BEQVw5ohbI&q=${latLng.lat},${latLng.lng}`}
                >
            </iframe> : <div>Would you like to park ?</div>}
            <button onClick={()=> getCurrentLocation(updateLatLng, setShowParkingAddressModal )}>Save Location</button>


        </div> )
    }



export default ParkingPage
